import React from 'react'
import './PropertyInfo.css'
import MessageToSeller from './MessageToSeller';
import ReportPublication from './ReportPublication';


const PropertyInfo = () => {
  return (
    <div className="property-info-page">
      <div className="property-info">
        <h1>Titulo de la Propiedad</h1>
        {/* Aquí coloca la información de la propiedad: fotos, ubicación, precio, etc. */}
      </div>
      <div className="side-container">
        <div className="seller-info-container">
          <h2>Información del Vendedor</h2>
          {/* Aquí coloca la información del vendedor: nombre, contacto, etc. */}
        </div>
        <div className="message-container">
          <h2>Enviar Mensaje al Vendedor</h2>
          <MessageToSeller />
          {/* Aquí coloca un formulario o componente para enviar mensajes al vendedor */}
        </div>
        <div className="report-container">
          <h2>Reportar Publicación</h2>
          <ReportPublication />
          {/* Aquí coloca un formulario o componente para reportar la publicación */}
        </div>
      </div>
    </div>
  );
};

export default PropertyInfo;
